import { useState } from "react";
import { useNavigate } from "react-router-dom";

export default function TodoList() {
  const [todos, setTodos] = useState([
    {
      id: 1,
      description: "Buy groceries",
      targetDate: new Date().toISOString(),
      completed: false,
    },
    {
      id: 2,
      description: "Finish project",
      targetDate: new Date().toISOString(),
      completed: true,
    },
  ]);
  const navigate = useNavigate();

  // Mock delete
  const deleteTodo = (id) => {
    setTodos(todos.filter(todo => todo.id !== id));
  };

  // Mock mark complete
  const markComplete = (todo) => {
    setTodos(todos.map(t =>
      t.id === todo.id ? { ...t, completed: true } : t
    ));
  };

  return (
    <div>
      <h2>üìã All Todos</h2>
      {todos.length === 0 ? (
        <p>No todos found.</p>
      ) : (
        <ul className="todo-list">
          {todos.map(todo => (
            <li key={todo.id} className={`todo-item ${todo.completed ? "completed" : ""}`}>
              <div>
                <strong>{todo.description}</strong> <br />
                <small>Due: {new Date(todo.targetDate).toLocaleDateString()}</small>
              </div>
              <div className="todo-actions">
                <button onClick={() => navigate(`/todoshome/edit/${todo.id}`)}>‚úèÔ∏è</button>
                <button onClick={() => deleteTodo(todo.id)}>üóëÔ∏è</button>
                {!todo.completed && (
                  <button onClick={() => markComplete(todo)}>‚úÖ</button>
                )}
              </div>
            </li>
          ))}
        </ul>
      )}
    </div>
  );
}
